interface SignUpFormData {
  title: string;
  description: string;
  formTag1: string;
  formTag2: string;
  formTag3: string;
}

export const Form = (formData: SignUpFormData) => {
  const navigate = useNavigate();
  const parameters: string | undefined = useParams().user;

  console.log(formData);
  return (
    <>
      <p
        className="redirect-sign-up"
        onClick={() =>
          navigate(`/signup/${parameters === "mentor" ? "business" : "mentor"}`)
        }
      >
        Wanna go home?
      </p>

      <p className="sign-up-title">
        {`${parameters?.slice(0, 1).toUpperCase()}${parameters?.slice(1)}`} Sign
        Up{" "}
      </p>
